я с поддержкой','Visit the Support'=>'Перейдите на поддержку','If the Documentation Guide didn\'t help you, contact us via our %1$sSupport Ticket%2$s. We reply to all the support queries within one business day, except on the weekends.'=>'Если руководство по документации вам не помогло, свяжитесь с нами через наш %1$sЗапрос в поддержку%2$s. Мы отвечаем на все запросы поддержки в течение одного рабочего дня, кроме выходных.','It\'s always better to visit our %1$sDocumentation Guide%2$s before you send us a support query.'=>'Всегда лучше посетить наш %1$sСправочник%2$s перед тем, как отправить нам запрос в службу поддержки.','Support Ticket'=>'Запрос в поддержку','View Documentation'=>'Смотреть документацию','Visit the Documentation'=>'Посмотрите документацию','Are you new to the WordPress world? Our step by step easy documentation guide will help you create an attractive and engaging website without any prior coding knowledge or experience.'=>'Вы новичок в мире WordPress? Наше пошаговое руководство по документации поможет Вам создать привлекательный и увлекательный сайт без каких-либо предварительных знаний и опыта в области кодирования.','View Our Documentation Link'=>'Ссылка на просмотр нашей документации','Also, when you submit the support ticket, please try to provide maximum details possible so that we can look into your issue in detail and solve it in minimum time. We recommend you to send us a screenshot(s) with issues explained and your website\'s address (URL).'=>'Кроме того, при подаче заявки в службу поддержки, пожалуйста, постарайтесь предоставить максимально подробную информацию, чтобы мы могли детально изучить вашу проблему и решить ее в кратчайшие сроки. Мы рекомендуем вам прислать нам скриншот(ы) с объяснением проблемы и адресом (URL) вашего сайта.','Please ensure that you have updated to the latest version of the theme before you submit a support ticket for any issue. We might have already fixed the bug in the previous theme update.'=>'Убедитесь, что вы обновились до последней версии темы, прежде чем отправлять заявку в службу поддержки по любому вопросу. Возможно, мы уже исправили ошибку в предыдущем обновлении темы.','How can I solve my issues quickly and get faster support?'=>'Как я могу быстро решить свои проблемы и получить быструю поддержку?','If this didn\'t help, please contact us via our %1$sSupport Ticket%2$s.'=>'Если это не помогло, пожалуйста, свяжитесь с нами через наш %1$sЗапрос в поддержку%2$s.','To solve the issue, deactivate all the plugins first, except the ones recommended by the theme. Then, hard reload your website using %1$s"Ctrl+Shift+R"%2$s on Windows and %1$s"Cmd+Shift+R"%2$s on Mac. If the issues are fixed, start activating the plugins one by one, and reload and check your site each time. This will help you find out the plugin that is causing the problem.'=>'Чтобы решить эту проблему, сначала отключите все плагины, кроме рекомендованных темой. Затем перезагрузите ваш сайт, используя %1$s"Ctrl+Shift+R"%2$s в Windows и %1$s"Cmd+Shift+R"%2$s на Mac. Если проблемы устранены, начните активировать плагины один за другим, и каждый раз перезагружайте и проверяйте свой сайт. Это поможет вам найти плагин, который вызывает проблему.','If your customizer is not loading properly or you are having issues with the theme, it might be due to the plugin conflict.'=>'Если настройка темы не загружается должным образом или возникают проблемы с темой, это может быть связано с конфликтом плагинов.','Why is my theme not working well?'=>'Почему моя тема не работает нормально?','You can change the copyright text going to %1$sAppearance > Customize > Footer Settings%2$s. However, if you want to hide the author credit text, please %3$supgrade to the Pro version%4$s.'=>'Вы можете изменить текст авторского права, выбрав  %1$sВид > Настройка > Настройки подвала %2$s. Однако, если вы хотите скрыть текст авторского права, пожалуйста, %3$sобновитесь до Pro версии %4$s.','How do I change the copyright text?'=>'Как мне изменить текст авторского права?','The Pro version is built with lots of flexibility in mind for future upgrades. Therefore, it is slightly different than the free theme but extremely flexible and easy-to-use.'=>'Pro версия построена с большой гибкостью для будущих обновлений. Поэтому она немного отличается от бесплатной темы, но чрезвычайно гибка и проста в использовании.','However, since the Pro version comes with added features and settings, you will need to set up the additional features in the customizer. This process is simple and only takes a few minutes.'=>'Однако, поскольку версия Pro поставляется с дополнительными функциями и настройками, вам нужно будет настроить дополнительные функции в настройке темы. Этот процесс прост и занимает всего несколько минут.','When you upgrade to the Pro theme, your posts, pages, media, categories, and other data will remain intact-- all your data is saved.'=>'При обновлении до темы Pro ваши записи, страницы, мультимедиа, рубрики и другие данные останутся без изменений-- все ваши данные будут сохранены.','Upgrading to the Pro version- will I lose my changes?'=>'Обновление до версии Pro - потеряю ли я свои изменения?','Along with the additional features and regular updates, you get dedicated and quick support with the premium theme. If you run into any issue while creating a website with the premium theme, you will get a quicker response compared to the free support.'=>'Наряду с дополнительными функциями и регулярными обновлениями, вы получаете специальную и быструю поддержку с премиум-темой. Если во время создания сайта с премиум-темой вы столкнетесь с какой-либо проблемой, вы получите более быстрый ответ по сравнению с бесплатной поддержкой.','What are the perks of upgrading to the Premium version?'=>'Каковы преимущества обновления до версии Premium?','Overall, you will have more control over the customization and editing of your website with the Pro version.'=>'В целом, вы будете иметь больше контроля над настройкой и редактированием сайта с помощью Pro версии.','Both the Free and Pro version of the themes are coded well and are developed with best coding practices. However, the Pro version of the theme comes with extended features and dedicated support team to help you solve your queries. The Pro theme comes with multiple homepage sections which you can sort and hide as per your requirements. Also, the Pro theme comes with several predefined page templates.'=>'Как Бесплатная, так и Про-версия тем хорошо закодированы и разработаны с использованием лучших практик кодирования. Тем не менее, Pro-версия темы поставляется с расширенными возможностями и специальной командой поддержки, чтобы помочь вам решить ваши запросы. Pro тема поставляется с несколькими разделами главной страницы, которые вы можете сортировать и скрывать в соответствии с вашими требованиями. Кроме того, Pro тема поставляется с несколькими предопределенными шаблонами страниц.','What is the difference between Free and Pro?'=>'Различия между бесплатной и платной версиями?','Jetpack Portfolio'=>'Портфолио Jetpack','Deactivate'=>'Деактивировать','Install and activate'=>'Установить и активировать','Skip to content (Press Enter)'=>'Перейти к содержимому (нажмите Enter)','VIEW PRO THEME'=>'ПОСМОТРЕТЬ ТЕМУ PRO','Pro Available'=>'Доступен Pro','Video Embed Link or Video URL'=>'Ссылка на встроенное видео или URL видео','Sidebar displaying only in woocommerce pages.'=>'Боковая панель отображается только на страницах WooCommerce.','Shop Sidebar'=>'Боковая панель магазина','Dismiss'=>'Отклонить','Go to the getting started.'=>'Перейдите для начала работы.','%1$s is now installed and ready to use. Click below to see theme documentation, plugins to install and other details to get started.'=>'%1$s теперь установлена и готова к использованию. Чтобы начать, нажмите ниже, чтобы увидеть документацию темы, плагины для установки и другие детали.','Congratulations!'=>'Поздравляем!','Comment'=>'Комментарий','Rara One Click Demo Import'=>'Rara O